deck_description:
READ OR YOU WILL NOT UNDERSTAND.
<h4><span>Use this boss card <a data-name="Shooting Riser Dragon">Shooting Riser Dragon</a> to get to different levels you can go down by 2,4,6,3. Some of your power cards are <a data-name="Virtual World Kyubi - Shenshe">Virtual World Kyubi - Shenshe</a>. <a data-name="Performage Trapeze Magician">Performage Trapeze Magician</a>. <a data-name="Supreme King Dragon Dark Rebellion">Supreme King Dragon Dark Rebellion</a>. <a data-name="Supreme King Dragon Clear Wing">Supreme King Dragon Clear Wing</a>. <a data-name="Harmonizing Magician">Harmonizing Magician</a>.</span></h4>
&nbsp;

<span>The reason for the </span><span>Virtual World card is they have a good extra deck and have nice levels like 6 and 3. </span>

&nbsp;

This deck is focused around getting materials for ritual summoning and then with almost the same material you use MoC's effect to destroy opponent's cards.

Your main boss monster is Magician of Chaos, but you can also bring out Chaos MAX Dragon or Magician of Black Chaos MAX

&nbsp;

This deck doesn't use Dragoon because I dislike that card even though it would probably make this deck a bit stronger. Besides, the main focus isn't on the Extra Deck

&nbsp;

Your main way to summon your ritual (and some fusion monsters) is by using Secrets of Dark Magic which you can search with Magician's Rod. You can also use classic ritual support (Manju, Impcantation, Preperation of Rites etc.)  need to get what you need.

&nbsp;

With Eternal Soul you can revive DM or CoM, after it is destroyed or tributed

&nbsp;

If you activate CoM's effect on opponent's turn you can destroy Artifact Scythe to prevent your opponent from using the Extra Deck

&nbsp;

Extra Deck is made out of generic DM and not-DM cards which you can bring out relatively easy considering that the Extra Deck isn't that important for the deck (besides maybe Dark Magicians and Ebon Illusion). So don't worry about Extravigance. But I did add Quintet and Magicalized Fusion to flex on people :)

Clown on your opponents by tapping and untapping your stuff and denying them the right to attack

&nbsp;

*<em>h</em><em>onk honk</em>*

Mill a bunch of cards to summon big bois and do big damage with negates on the side. (fun fact: link monsters don't have levels or ranks)

&nbsp;

Edit: removed normal summonable handtraps I put in because I'm an idiot.

BATTLIN' BOXER with a sprinkle of heresy

&nbsp;

THANK YOU
